                function lang_for_1_7_6(lang_code){
                    var js_lang_array = [];
                    js_lang_array['es'] = 1; js_lang_array['ca'] = 2; js_lang_array['gl'] = 3; js_lang_array['eu'] = 4;  
                        return js_lang_array[lang_code];
