                function sds_id_lang(lang_code = null) { 
                    if(lang_code == null){
                        if(pageType == 'cms'){
                        var lang_code = \$('#cms_page_meta_title').html();
                        lang_code = \$.trim(lang_code);
                        var id_lang = window.lang_for_1_7_6(lang_code); 
                        }else if(pageType == 'category'){
                            var lang_code = \$('#category_meta_title').html();
                            lang_code = \$.trim(lang_code);
                            var id_lang = window.lang_for_1_7_6(lang_code); 
                        }else if(pageType == 'manufacturer'){
                            var lang_code = \$('#manufacturer_meta_title').html();
                            lang_code = \$.trim(lang_code);
                            var id_lang = window.lang_for_1_7_6(lang_code);
                            // alert(id_lang);
                        }else{
                            if(document.getElementById('form_switch_language')){
                            var js_lang_array = [];
                            js_lang_array['es'] = 1; js_lang_array['ca'] = 2; js_lang_array['gl'] = 3; js_lang_array['eu'] = 4;                             var e = document.getElementById(\"form_switch_language\");
                            var ev = e.options[e.selectedIndex].value;
                            return js_lang_array[ev];
                            }else if(typeof window.id_language != 'undefined'){
                                return window.id_language;
                            }else{
                                return window.id_lang;
                            }
                        }   
                        if (id_lang == null) {
                            id_lang = 1;
                        }
                    }else{ 
                        lang_code = \$.trim(lang_code);
                        var id_lang = window.lang_for_1_7_6(lang_code); 
                    }
                    // alert(id_lang);
                    return id_lang;
                }
                function changeFrontEditorLang(lang_code = null) {  
                    var switch_front = \$('a.wpb_switch-to-front-composer');
                    var found = sds_id_lang(lang_code); 
                    
                    if (switch_front.length > 0) {
                        var link = switch_front.attr('href');
                        link = link.replace(/id_lang=([0-9]+)/, 'id_lang=' + found);
                        switch_front.attr('href', link);
                        if (\$('#wpb-edit-inline').length)
                            \$('#wpb-edit-inline').attr('href', link);
                    } 

                    \$('.wpb_switch-to-composer').click();  
                }
                \$(function () {
                    \$(document.body).on('focusout', '.translatable-field ul.dropdown-menu li a', function () {
                        changeFrontEditorLang();
                    }); 

                    \$(document.body).on('click', '.js-locale-item', function () {
                        var lang_code = \$(this).attr(\"data-locale\"); 
                        changeFrontEditorLang(lang_code);
                    });
                    \$(document.body).on('click', '.translationsLocales a', function () {
                        var lang_code = \$(this).attr(\"data-locale\"); 
                        changeFrontEditorLang(lang_code);
                    });

                    \$(document.body).on('change', '#form_switch_language', function () {
                        var lang_code = \$('#form_switch_language').val();  
                        changeFrontEditorLang(lang_code);
                    }); 

                }); 
            </script>
